function windowWidthToZoom() {
  if (window.innerWidth < 1300) {
    return 10;
  } else {
    return 11;
  }

}

function resetState() {
  /*
  Revert the map back to the initial state
  */

  for (var i=0; i < allTrailMarkers.length; i++) {
    map.removeLayer(allTrailMarkers[i]);
  }

  // remove all paths
  for (var e in polyLinePoints) { map.removeLayer(polyLinePoints[e]) }

  lostCoastTrailMarker.addTo(map);
  lostCoastTrailMarker.eachLayer(function(m) {
    m.openPopup();
  });

  map.setView(INITIAL_VIEW, 7);
  scrollPanel.onscroll = _.debounce(function(){
                            initialInteract(map);
                         }, DEBOUNCE_INTERVAL);

}

function getNumPointsPassed() {
  /*
  Return the number of points (div's with class .point) that we have scrolled passed.
  */
  var counter = 0;
  var windowHeight = window.innerHeight;
  var currPoint = null;

  for (var i=0; i<pointsOfInterest.length; i++) {
    var rect = pointsOfInterest[i].getBoundingClientRect();

    // If the bottom of the picture has reached the bottom of the screen
    if ((rect.bottom + BUFFER) < windowHeight) {
      currPoint = pointsOfInterest[i].id;
      counter++;
    }
  }
  return {'count': counter, 'currPoint': currPoint}
}

function drawMap(lat, lng, zoom) {

  var coordinates = [parseFloat(lat), parseFloat(lng)]
    zoom = parseFloat(zoom);

  map.setView(coordinates, zoom);

  // Disable drag and zoom handlers.
  map.touchZoom.disable();
  map.doubleClickZoom.disable();
  map.scrollWheelZoom.disable();
  map.keyboard.disable();

  lostCoastTrailMarker.eachLayer(function(m) {
    m.openPopup();
  });

  scrollPanel.onscroll = _.debounce(function(){
                            initialInteract();
                         }, DEBOUNCE_INTERVAL);

}

function initialInteract() {
  /*
  Modify the map object based on the current scroll posiition.
  */

  // TODO: move this out of the function
  var textAreaHeight = $('#main>.row')[0].offsetHeight;
  // var headerHeight = $('.navbar-header')[0].offsetHeight;
  var headerHeight = textAreaHeight;

  // set the view to the lost coast trail view, add the markers
  var dayOneSection = $('#saturday-day-1')[0].getBoundingClientRect()
  if (dayOneSection.bottom < (textAreaHeight + headerHeight + 15)) {
    map.setView(LOST_COAST_TRAIL, windowWidthToZoom());
    map.removeLayer(lostCoastTrailMarker);

    for (var i=0; i<allTrailMarkers.length; i++) {
      allTrailMarkers[i].addTo(map);
    }

    scrollPanel.onscroll = _.debounce(function(){
                            drawPointsInteractive();
                         }, DEBOUNCE_INTERVAL);
  }

}

function drawPointsInteractive() {
  /*
  Draw the paths associated with each image passed
  */
  var scrollInfo = getNumPointsPassed()

  var currNumPointsPassed = scrollInfo.count;
  var currPoint = scrollInfo.currPoint;

  // if the interactive section of the post is no longer visible.
  var dayOneSection = $('#saturday-day-1')[0].getBoundingClientRect()
  if (dayOneSection.bottom > window.innerHeight) {
    resetState();
    return
  }

  if (point === currPoint) return;

  var prevPoint = point;
  var prevNumPointsPassed = numPointsPassed;

  // update the global state
  point = currPoint;
  numPointsPassed = currNumPointsPassed;

  if (currNumPointsPassed > prevNumPointsPassed) {
    // we are scrolling down so add the layer
    map.addLayer(polyLinePoints[currPoint]);
  } else {
    map.removeLayer(polyLinePoints[prevPoint]);
  }

}

